import React from "react";
import {ContentList} from './contentStyles';

function Content() {
    return fetch('https://604048b4f34cf600173c7cda.mockapi.io/api/v1/list-artisan')
    .then((response) => response.json())
    .then((responseJson) => {
      return responseJson.image;
    })
    .catch((error) => {
      console.error(error);
    });
